INSERT INTO `medicine_info` (`working_code`, `itemcode`, `format1`, `packing_size`, `format_itemcode`, `container1`) VALUES
(1000010, 'Acyclovir 400 mg tab', ' กล่อง', '70 เม็ด/กล่อง', 'เป็นยาเม็ด ชนิดรับประทาน', 'บรรจุในแผงอลูมิเนียมฟอยล์ หรือ blister pack หรือ\r\n- ภาชนะปิดสนิท เช่น ขวด หรือภาชานะรูปแบบเฉพาะ ฉลาก ระบุชื่อยา ส่วนประกอบตัวยาสำคัญและความแรง วันผลิต วันสิ้นอายุ เลขที่ผลิต และเลขทะเบียนตำรับยา ไว้ชัดเจนปรากฏบนบรรจุภัณฑ์\r\n- กรณีที่บรรจุในแผงอลูมิเนียมฟอยล์หรือ blister pack ต้องระบุวัน เดือน ปีที่ยาหมดอายุ, เลขที่ผลิตไว้ ชัดเจนบนแผง'),
